  box-sizing: border-box;
}
/* Center Nav title */
.nav-head {
  position: absolute;
  width: 100vw;
  display: block;
  text-align: center;
}

/* Make sure this toggler has higher index than title */
.navbar-toggler {
  z-index: 10;
}
.image-upload {
  width: 100%;
  height: 5rem;
}

.canvas-area {
  box-sizing: border-box;
}
img {
  background-repeat: no-repeat;
  background-size: cover;
  max-width: 65vw;
  max-height: 50vh;
}
.caption {
  height: 4rem;
  background-color: hsla(120, 14%, 11%, 0.7);
}
.text-detected {
  color: #ffffff;
  font-size: 1.2rem;
}
main button {
  min-width: 8rem;
  min-height: 3rem;
}
.hidden {
  display: none;
}
